import React, {Component} from "react";
import {View, StyleSheet, Text} from "react-native";

class Menu extends Component {
    render() {
        return (
            <View>
                <Text>Menu Tab</Text>
            </View>
        );
    }
}

const styles = StyleSheet.create({});

export default Menu;
